import { useParams } from "react-router-dom";
import useFetchData from "../apiFetches/FetchData";
import { RedirectButton } from "../components/RedirectButton";
import UserCard from "../components/UserCard";

const User = () => {
  const { user } = useParams();
  const apiData = useFetchData(`/users/${user}`);
  //Extract only what is required
  return (
    <>
      <RedirectButton previousPage={"/"} />
      {apiData.loading ? <div>Loading</div> : <UserCard {...apiData} />}
    </>
  );
};
export default User;
